INSERT INTO `products_i18n` (`ID`, `productID`, `lang`, `name`, `description`, `slugname`) VALUES
(1, 2, 'en', 'Double Cheesburger', 'We make it like we always have: two slices of processed cheddar cheese with two 100% pure Canadian beef patties, pickles, onions, ketchup and mustard on a freshly toasted bun.', ''),
(2, 2, 'fr', 'Double Hamburger avec Fromage', 'Toujours préparé de la même façon : deux tranches de fromage cheddar fondu et deux pâtés de bœuf canadien pur à 100 %, garnis de cornichons, d’oignons, de ketchup et de moutarde sur un petit pain fraîchement grillé.\r\n', ''),
(3, 3, 'en', 'Angus Classic', 'Bigger really is better when you meet our third-pound* 100% Angus beef patty on a delicious bakery style sesame bun. We then add two slices of savoury bacon and processed cheddar cheese and top it off with crisp red onions and crinkle-cut pickles.', 'angus-classic'),
(4, 3, 'fr', 'Angus Classique', 'Notre sandwich Tiers de livre Angus avec bacon et fromage commence par un généreux Tiers de livre de bœuf Angus pur à\r\n100 % savoureux à souhait, garni de rondelles d’oignons rouges et de tranches de cornichons auxquelles nous ajoutons deux tranches de bacon savoureux et du fromage cheddar fondu, le tout servi sur un petit pain gourmet avec graines de sésame.', 'angus-classique'),
(5, 4, 'en', 'Big Burger', 'One of a kind, legendary Big Burger, made with two 100% Canadian beef patties, special sauce, crisp lettuce, processed cheddar cheese, pickles and onions on a toasted sesame seed bun. Nothing compares to the taste.', 'big-burger'),
(6, 4, 'fr', 'Grand Burger', 'Unique en son genre, le légendaire Big Burger est fait de deux pâtés de bœuf canadien pur à 100 %, accompagnés d’une sauce spéciale, de laitue croquante, de fromage cheddar fondu, de cornichons et d’oignons, le tout déposé sur un petit pain au sésame grillé. Un goût sans égal!', 'grand-burger'),
(7, 5, 'en', 'Cheeseburger', 'A slice of melted processed cheddar cheese on a juicy, 100% pure Canadian beef patty with tangy pickles and onions, ketchup and mustard on a freshly-toasted bun.', 'cheeseburger'),
(8, 5, 'fr', 'Hamburger avec fromage', 'Une tranche de fromage cheddar fondu déposée sur un pâté tendre de bœuf canadien pur à 100 %, le tout garni de cornichons acidulés, d’oignons, de ketchup et de moutarde sur un petit pain fraîchement grillé', 'hamburger-avec-fromage'),
(9, 7, 'en', 'Mediterranean Wrap', 'Loaded with fresh tomatoes, cucumbers, red onions, shredded lettuce and feta cheese, topped with lemon crispy onions and mediterranean sauce, all wrapped in a warm whole wheat soft-shell tortilla.', 'mediterranean-wrap'),
(10, 7, 'fr', 'Wrap méditerranéen aux légumes', 'Des tomates fraîches, du concombre, des oignons rouges, de la laitue en lanières et du fromage féta, le tout garni d’oignons croustillants assaisonnés au citron et de sauce méditerranéenne, enroulé dans une tortilla souple de blé entier chaude.', 'wrap-méditerranéen-aux-légumes');

